import {
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
} from "@mui/material";
import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { VerkrijgReeksenVanRonde } from "PropagandaSysteem/src/ApplicationLayer/Organisatie/Race/RaceUseCases";
import ApplicationState from "PropagandaSysteem/src/ApplicationLayer/ApplicationState";
import { VerkrijgReeksenVanRondeResponse } from "PropagandaSysteem/src/ApplicationLayer/Organisatie/Race/RaceResponses";

export default function RaceTable() {
  const params = useParams();
  const [reeksen, setReeksen] = useState<
    VerkrijgReeksenVanRondeResponse | undefined
  >(undefined);
  useEffect(() => {
    console.log(params.raceTitle);
    console.log(params.rondeTitle);

    setReeksen(
      VerkrijgReeksenVanRonde(
        {
          raceTitle: params.raceTitle!,
          rondeTitle: params.rondeTitle!,
        },
        ApplicationState.getInstance()
      )
    );

    console.log("reeksen", reeksen);
  }, [params]);

  function createData(
    id: number,
    lane: number,
    firstName: string,
    lastName: string,
    category: string,
    club: string
  ) {
    return { id, lane, firstName, lastName, category, club };
  }

  const rows = [createData(1, 1, "Bram", "Sikkens", "SEN_H", "KCCM")];

  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Lane</TableCell>
            <TableCell align="right">Naam</TableCell>
            <TableCell align="right">Category</TableCell>
            <TableCell align="right">Club</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {reeksen?.reeksen.map((reeks) => (
            <TableRow
              key={row.id}
              sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
            >
              <TableCell>{row.lane}</TableCell>
              <TableCell align="right">{row.firstName}</TableCell>
              <TableCell align="right">{row.category}</TableCell>
              <TableCell align="right">{row.club}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
